Bulk Change for a field type in MongoDB<p>I need to change a field type from int32 to string. This change is for data in a server and for a huge amount of documents. </p>

<p>With a simple update like the following only a small part of the documents get updated due to time issues:</p>

<pre><code>db.collection.find({"identifier": {$exists:true}})
    .forEach( function(x) {
        db.collection.update({_id: x._id}, {$set: {"identifier": 
        x.identifier.toString()}});
    }
);
</code></pre>

<p>So I decided to do a bulk change:</p>

<pre><code>var bulk = db.collection.initializeUnorderedBulkOp();
bulk.find({"identifier": {$exists:true}}).update(
    function(x) {
        {_id: x._id}, {$set: {"identifier": x.identifier.toString()}}
    });
bulk.execute();
</code></pre>

<p>But it gives an error and does not get executed.</p>

<p>How should I do the update for the bulk to work? </p>

