<pre><code>status: {
        $let: {
          vars: {
            tasksCount: tasksCountMap['$gradeLevel'],
            completedTasksCount: '$completedTasksCount[0].count'
          },
          in: {
            $cond: {
              if: { $or: [
                { $eq: ['$$tasksCount', '$$completedTasksCount'] },
                { $lte: ['$$tasksCount', '$$completedTasksCount'] },
              ]},
              then: 'On track',
